import axios from "axios";

export default function AdminProducts() {
  const addProduct = async () => {
    await axios.post("http://localhost:5000/api/products", {
      name: "New Product",
      price: 1000,
      stock: 10
    });
    alert("Product Added");
  };

  return <button onClick={addProduct}>Add Product</button>;
}
